svg.script:

var ZylinderCount = 0;
var BirnenCount = 0;
var MundstueckCount = 0;
var TrichterCount = 0;

var ZylinderAbschnitt = document.getElementById("ZylinderAbschnitt");
var ZylinderRect = document.getElementById("ZylinderRect");
var ZylinderText = document.getElementById("ZylinderText");

var BirnenAbschnitt = document.getElementById("BirnenAbschnitt");
var BirnenRect = document.getElementById("BirnenRect");
var BirnenText = document.getElementById("BirnenText");

var MundstueckAbschnitt = document.getElementById("MundstueckAbschnitt");
var MundstueckRect = document.getElementById("MundstueckRect");
var MundstueckText = document.getElementById("MundstueckText");

var TrichterAbschnitt = document.getElementById("TrichterAbschnitt");
var TrichterRect = document.getElementById("TrichterRect");
var TrichterText = document.getElementById("TrichterText");

var ZylinderButton = document.getElementById("ZylinderButton");
var BirnenButton = document.getElementById("BirnenButton");
var MundstueckButton = document.getElementById("MundstueckButton");
var TrichterButton = document.getElementById("TrichterButton");

var ZylinderSchalter = document.getElementById("ZylinderSchalter");
var BirnenSchalter = document.getElementById("BirnenSchalter");
var MundstueckSchalter = document.getElementById("MundstueckSchalter");
var TrichterSchalter = document.getElementById("TrichterSchalter");

var Zylinder = document.getElementById("Zylinder");
var Zylinder_ohne_Mundstueck = document.getElementById("Zylinder_ohne_Mundstueck");

var Roehre = document.getElementById("Roehre");

var Birne = document.getElementById("Birne")

var Mundstueck = document.getElementById("Mundstueck");

var Trichter = document.getElementById("Trichter");

function addEventListeners() {

    ZylinderButton.addEventListener('mousedown', Zylinderdruck);
    ZylinderButton.addEventListener('mouseup', Zylinderlos);
    ZylinderButton.addEventListener('mouseout', Zylinderfort);

    BirnenButton.addEventListener('mousedown', Birnendruck);
    BirnenButton.addEventListener('mouseup', Birnenlos);
    BirnenButton.addEventListener('mouseout', Birnenfort);

    MundstueckButton.addEventListener('mousedown', Mundstueckdruck);
    MundstueckButton.addEventListener('mouseup', Mundstuecklos);
    MundstueckButton.addEventListener('mouseout', Mundstueckfort);

    TrichterButton.addEventListener('mousedown', Trichterdruck);
    TrichterButton.addEventListener('mouseup', Trichterlos);
    TrichterButton.addEventListener('mouseout', Trichterfort);
}

addEventListeners()

function Zylinderdruck() {
    ZylinderSchalter.classList.remove("Bfrei");
    ZylinderSchalter.classList.add("Bgedrueckt");
}

function Zylinderlos() {
    ZylinderSchalter.classList.remove("Bgedrueckt");
    ZylinderSchalter.classList.add("Bfrei");
    if (ZylinderCount == 0) {
    ZylinderRect.style.fill = "#ffffff";
    ZylinderText.style.fill = "#ffffff";
    Roehre.classList.remove("unsichtbar");
    Roehre.classList.add("sichtbar");
    ZylinderCount = 1;
    }
    else {
    ZylinderRect.style.fill = "#99999a";
    ZylinderText.style.fill = "#99999a";
    Roehre.classList.remove("sichtbar");
    Roehre.classList.add("unsichtbar");
    ZylinderCount = 0;
    }
}

function Zylinderfort() {
    ZylinderSchalter.classList.remove("Bgedrueckt");
    ZylinderSchalter.classList.add("Bfrei");

}
function Birnendruck() {
    BirnenSchalter.classList.remove("Bfrei");
    BirnenSchalter.classList.add("Bgedrueckt");
}

function Birnenlos() {
    BirnenSchalter.classList.remove("Bgedrueckt");
    BirnenSchalter.classList.add("Bfrei");
    if (BirnenCount == 0) {
    BirnenRect.style.fill = "#eebbff";
    BirnenText.style.fill = "#eebbff";
    Birne.classList.remove("unsichtbar");
    Birne.classList.add("sichtbar");
    BirnenCount = 1;
    }
    else {
    BirnenRect.style.fill = "#99999a";
    BirnenText.style.fill = "#99999a";
    Birne.classList.remove("sichtbar");
    Birne.classList.add("unsichtbar");
    BirnenCount = 0;
    }
}

function Birnenfort() {
    BirnenSchalter.classList.remove("Bgedrueckt");
    BirnenSchalter.classList.add("Bfrei");

}

function Mundstueckdruck() {
    MundstueckSchalter.classList.remove("Bfrei");
    MundstueckSchalter.classList.add("Bgedrueckt");
}

function Mundstuecklos() {
    MundstueckSchalter.classList.remove("Bgedrueckt");
    MundstueckSchalter.classList.add("Bfrei");
    if (MundstueckCount == 0) {
    MundstueckRect.style.fill = "#ff8080";
    MundstueckText.style.fill = "#ff8080";
    Mundstueck.classList.remove("unsichtbar");
    Mundstueck.classList.add("sichtbar");
    Zylinder.classList.remove("sichtbar");
    Zylinder.classList.add("unsichtbar");
    MundstueckCount = 1;
    }
    else {
    MundstueckRect.style.fill = "#99999a";
    MundstueckText.style.fill = "#99999a";
    Mundstueck.classList.remove("sichtbar");
    Mundstueck.classList.add("unsichtbar");
    Zylinder.classList.remove("unsichtbar");
    Zylinder.classList.add("sichtbar");
    MundstueckCount = 0;
    }
}

function Mundstueckfort() {
    MundstueckSchalter.classList.remove("Bgedrueckt");
    MundstueckSchalter.classList.add("Bfrei");

}


function Trichterdruck() {
    TrichterSchalter.classList.remove("Bfrei");
    TrichterSchalter.classList.add("Bgedrueckt");
}

function Trichterlos() {
    TrichterSchalter.classList.remove("Bgedrueckt");
    TrichterSchalter.classList.add("Bfrei");
    if (TrichterCount == 0) {
    TrichterRect.style.fill = "#89bbff";
    TrichterText.style.fill = "#89bbff";
    Trichter.classList.remove("unsichtbar");
    Trichter.classList.add("sichtbar");
    TrichterCount = 1;
    }
    else {
    TrichterRect.style.fill = "#99999a";
    TrichterText.style.fill = "#99999a";
    Trichter.classList.remove("sichtbar");
    Trichter.classList.add("unsichtbar");
    TrichterCount = 0;
    }
}

function Trichterfort() {
    TrichterSchalter.classList.remove("Bgedrueckt");
    TrichterSchalter.classList.add("Bfrei");

}
